window.bookSummaryJSON = "<p>Bloomsbury presents Defend the Dawn by Brigid Kemmerer, read by Chase Brown, Lexie McDougall and Christopher Ragland.<br> <br> In the eagerly anticipated sequel to the New York Times bestseller Defy The Night author Brigid Kemmerer continues her electrifying series with more royal intrigue, more sizzling romance, and shocking twists that will leave readers breathless. <br> <br> What will they sacrifice to save their kingdom?<br> Their honor?<br> Their love?<br> Their lives?<br> <br> Tessa Cade has gone from masked outlaw to palace advisor, but even with her newfound power, she can’t stop the sickness still raging. And the kingdom’s supply of Moonflower elixir dwindles all the while. Prince Corrick is trying to find a new way to lead, but it isn’t easy to repair the rift between the royals and the people—or the one growing between himself and Tessa. <br> <br> When an emissary from a neighboring kingdom arrives with an intriguing offer, Tessa and Corrick set out on an uncertain journey to find a new source of the lifesaving elixir. But with tensions brewing on deck and the sea swirling below, Tessa and Corrick must decide who they can trust—including each other. But they’re shocked to discover that a craven betrayal may be much closer than they think . . .</p>"; 
